import badgeJs from "../../../Image/course/tag-js.svg";
import badgePuzzle from "../../../Image/course/tag-puzzle.svg";
import badgePython from "../../../Image/course/tag-python.svg";

import noResult from "../../../Image/course/no-result.svg";

const IMAGE = {
  BADGE_JS: badgeJs,
  BADGE_PUZZLE: badgePuzzle,
  BADGE_PYTHON: badgePython,

  NO_RESULT: noResult,
} 

export default IMAGE;
